const GetRest = () => {
    const [posts, setPosts] = useState([]);

    useEffect(() => {

        fetch('http://192.168.1.26:8050/api/records/')
            .then((response) => response.json())
            .then((data) => {
                let records = []
                const number = Object.keys(data).length;
                for (let i = number - 10; i < number; i++) {
                    records.push(data[i])
                }
                setPosts(records);
                console.log('out');
                console.log(posts[1]);
            })
            .catch((err) => {
                console.log(err.message);
            });
    }, []);

